        </div>
    </div>

    <section class=""big_wrapper"">

        <div class=""rules"">
            <p>臺北市國小學童發揮創意進行自製照片，展現拒菸信念。</p>
            <p>
                <b>一、主辦單位：臺北市衛生局、臺北市教育局、董氏基金會</b>
            </p>
            <p>
                <b>二、參加對象：臺北市各公私立國民小學學生。</b>
            </p>
            <p>
                <b>三、參加方式：</b>
                <br>
                拒絕所有菸害表態，呈現方式不拘，以照片投稿上傳，盡情展現個人或家庭的「我拒菸我驕傲」的信念。
            </p>
            <p>
                <b>四、作品規範：</b>
                <br>
                (1)	須以照片呈現，可用數位相機或智慧型手機拍攝。(可請家長或老師協助拍照上傳)
                <br>
                (2)	上傳照片須3M以下，畫質清晰。
                <br>
                (3)	照片須符合「拒菸」主題概念。但不得出現吸菸形象與菸品品牌名稱，如需出現菸品應以道具替代。
                <br>
                (4)	基本資料務必完整填寫。
                <br>
                (5)	自由填寫照片理念(200字為限)。
                <br>
                (6)	請用下列正確文字：菸品、紙菸、電子煙、加熱菸、新興菸品、新型菸品、吸菸危害、菸害防制法。
            </p>
            <p>
                <b>五、獎品：</b>得獎獎品總價值新台幣陸萬元整。《");
                WriteLiteral(@"獎品擬由吳尊賢文教基金會贊助》
                <br>
                (1)	低年級(1、2年級) 20名，每名郵局禮券1000元及獎狀乙紙。
                <br>
                (2)	中年級(3、4年級) 20名，每名郵局禮券1000元及獎狀乙紙。
                <br>
                (3)	高年級(5、6年級) 20名，每名郵局禮券1000元及獎狀乙紙。
            </p>
            <p>
                <b>六、報名辦法：</b>
                <br>
                (1)	照片上傳至3/5截止。
                <br>
                (2)	報名網址：「我拒菸，我驕傲」網站(
                <a href=""http://jolin.e-quit.org/"" target=""_new"">http://jolin.e-quit.org/</a>) 點選【臺北市國小學童作品募集】，填妥基本資料並上傳照片，報名成功者可下載「我拒菸我驕傲證明」。
                <br>
                (3)	照片經主辦單位人工審核確認是否符合主題，核准後會發布於「我拒菸我驕傲」首頁，因此作品上傳後並非立即公布。
            </p>
            <p id=""anchor"">
                <b>七、	評選機制：主題性 30％ 、創意巧思 30％ 、整體表現 40％</b>
            </p>
            <table>
                <thead>
                    <tr>
                        <th></th>
                        <th>評分準則</th>
                        <th>權重</th>
                    </tr>
                </the");
                WriteLiteral(@"ad>
                <tbody>
                    <tr>
                        <td>主題性</td>
                        <td>作品內容符合主題、對於議題了解程度</td>
                        <td>30%</td>
                    </tr>
                    <tr>
                        <td>創意巧思</td>
                        <td>作品整體創意性、獨特</td>
                        <td>30%</td>
                    </tr>
                    <tr>
                        <td>整體表現</td>
                        <td>作品理念、作品內容傳達</td>
                        <td>40%</td>
                    </tr>
                    <tr>
                        <td></td>
                        <td>合計</td>
                        <td>100%</td>
                    </tr>
                </tbody>
            </table>
            <p>
                <b>八、得獎公佈：</b>擬於3月中旬前在「我拒我驕傲」網站、「拒菸Jolin粉專頁」及「臺北市政府衛生局/菸害防制專區」公布得獎名單，同時將電話聯絡得獎者導師。
            </p>
            <p id=""policy_content"">
                <b>九、肖像與隱私權授權同意：</b>同意並授權董氏基金會、臺北市政府衛生局與臺北市政府教育局在菸害防制相關議題使用、修飾");
                WriteLiteral(@"、公開展示照片。參加本活動者提供或填寫個人資料後，視為同意本主辦方將其資料於本活動目的範圍內搜集、處理暨使用之。此次提供之資料，本主辦方將遵守【個人資料保護法】之相關規定，以維護參加者權益。
            </p>
            <p>
                <b>十、特別說明：</b>
                <br>
                (1)得獎者須簽禮券領取單，請據實填寫中文姓名全名。
                <br>
                (2)本獎項免予扣繳，但懇請提供身分證影本資料以供存查。
            </p>
        </div>

